import { useEffect } from "react";

class Particle {
    effect: Effect;
    x: number;
    y: number;
    originX: number;
    originY: number;
    color: string;
    size: number;
    vx: number;
    vy: number;
    ease: number;
    friction: number;
    dx: number;
    dy: number;
    distance: number;
    force: number;
    angle: number;

    constructor(effect, x, y, color) {
        this.effect = effect;
        this.x = Math.random() * this.effect.width;
        this.y = Math.random() * this.effect.height;
        this.originX = Math.floor(x);
        this.originY = Math.floor(y);
        this.color = color;
        this.size = this.effect.gap;
        this.vx = 0;
        this.vy = 0;
        this.ease = 0.25;
        this.friction = 0.8;
        this.dx = 0;
        this.dy = 0;
        this.distance = 0;
        this.force = 0;
    }
    draw(context) {
        context.fillStyle = this.color;
        context.fillRect(this.x, this.y, this.size, this.size);
    }
    update() {
        this.dx = this.effect.mouse.x - this.x - ((window.innerWidth - this.effect.width) / 2);
        this.dy = this.effect.mouse.y + this.effect.mouse.scrollPosition - 225 - this.y - ((window.innerHeight - this.effect.height) / 2);
        this.distance = this.dx * this.dx + this.dy * this.dy;  
        this.force = -this.effect.mouse.radius / this.distance;

        if (this.distance < this.effect.mouse.radius) {
            this.angle = Math.atan2(this.dy, this.dx);
            this.vx += this.force * Math.cos(this.angle);
            this.vy += this.force * Math.sin(this.angle);
        }

        this.x += (this.vx *= this.friction) + (this.originX - this.x) * this.ease;
        this.y += (this.vy *= this.friction) + (this.originY - this.y) * this.ease;
    }
}

class Effect {
    width: number;
    height: number;
    particles: Particle[];
    image;
    centerX: number;
    centerY: number;
    x: number;
    y: number;
    gap: number;
    mouse: {
        radius: number;
        x: number;
        y: number;
        scrollPosition: number;
    }

    constructor(width, height) {
        this.width = width;
        this.height = height;
        this.particles = [];
        this.image = document.getElementById("image");
        this.centerX = this.width / 2;
        this.centerY = this.height / 2;
        this.x = (this.width - (this.image.width)) / 2;
        this.y = (this.height - (this.image.height)) / 2;
        this.gap = 2;
        this.mouse = {
            radius: 10000,
            x: undefined,
            y: undefined,
            scrollPosition: 0
        }
        window.addEventListener("mousemove", (event) => {
            this.mouse.x = event.x;
            this.mouse.y = event.y;
        });
        window.addEventListener("scroll", () => {
            this.mouse.scrollPosition = Math.round(window.scrollY);
        })
    }
    init(context){
        context.drawImage(this.image, this.x, this.y, this.image.width, this.image.height);
        const data = context.getImageData(0, 0, this.width, this.height).data;
        for (let y = 0; y < this.height; y += this.gap) {
            for (let x = 0; x < this.width; x += this.gap) {
                const index = ((this.width * y) + x) * 4;
                const alpha = data[index + 3];
                if (alpha) {
                    const red = 25//data[index];
                    const green = 25//data[index + 1];
                    const blue = 36//data[index + 2];
                    const color = `rgb(${red},${green},${blue})`;
                    this.particles.push(new Particle(this, x, y, color));
                }
            }
        }
    }
    draw(context){
        this.particles.forEach(particle => particle.draw(context));
    }
    update(){
        this.particles.forEach(particle => particle.update());
    }
}

const initParticles = () => {
    const canvas = document.getElementById("canvas");
    const ctx = canvas.getContext("2d");
    const width = canvas.width = 800;
    const height = canvas.height = 800;

    const effect = new Effect(width, height);
    effect.init(ctx);
    console.log(effect);

    function animate() {
        ctx.clearRect(0, 0, width, height);
        effect.draw(ctx);
        effect.update();
        requestAnimationFrame(animate);
    }
    animate();
}

export function ParticlePhysics(props) {

    useEffect(() => {
        window.addEventListener("load", initParticles, false);
    }, []);
        
    return (
        <div {...props}>
            <canvas id="canvas" width="800" height="800"></canvas>
            <img id="image" src="data:image/png;base64," alt="Logo" layout="fill" display="none"/>
        </div>
    )
}